import React from 'react';


const index = ({ source, company, job, time, location}) => {
  return (
    <div className='job-list'>
        <div>
          <img
            src={source}
            alt=""
            width={35}
            height={35}
          />
          <div className='airbnb'>
            <h3>{company}</h3>
            <span>{job}</span>
            <span>{time}</span>
          </div>
        </div>
        <span>{location}</span>
      </div>
  )
}

export default index
